import { useState, useEffect } from "react";
import feather from "feather-icons"

function Header(){
    const [isSidebarOpen, setIsSidebarOpen] = useState(false);

    useEffect(() => {
        feather.replace();
    }, [isSidebarOpen]); 

    return(
        <header className="navi">
            <div className="navi-container">
            <ul>
                <img src="/imgs/temple.png" alt="Logo" />
                <nav className="desktop-navi">
                    <div className="links">

                        <ul className={`sidebar ${isSidebarOpen ? 'open' : ''}`}>
                                <li><a href="#">Home</a></li>
                                <li><a href="#">Über uns</a></li>
                                <li><a href="#">Wettbewerbe</a></li>
                                <li><a href="#">Trainingszeiten</a></li>
                        </ul>
                        <li><a href="#">Home</a></li>
                        <li><a href="#">Über uns</a></li>
                        <li><a href="#">Wettbewerbe</a></li>
                        <li><a href="#">Trainingszeiten</a></li>
                        <li>
                            <a 
                                href="#" 
                                onClick={(e) => {
                                    e.preventDefault();
                                    setIsSidebarOpen(!isSidebarOpen);
                                }} 
                                rel="noreferrer"
                                className="menu-icon"
                            >
                                <i data-feather={isSidebarOpen ? "x" : "menu"}></i>
                            </a>
                        </li>
                    </div>
                </nav>
            </ul>
            </div>
        </header>
    );
}


export default Header;
